import React from 'react';
import Layout from '../../../../../adminPages/layout/Layout';
import Header from '../../../../../pageSettings/header/Header';
import style from '../../';
import LinkLayout from '../../../../../adminPages/layout/layoutLink/LinkLayout';

function productsSSD() {
  return (
    <Layout>
      <Header h1Heading='SSD Products' />
      <section className={style.container}>
        <LinkLayout toLink='/productSsdM2' nameLink='product SSD M2' />
        <LinkLayout toLink='/productSsdSata' nameLink='product SSD Sata' />
      </section>
    </Layout>
  );
}

export default productsSSD;
